const styles = {
    ul:{
        listStyle:'none',
        display:'flex',
        justifyContent:'space-between',
        textDecoration:'none'

    }
}


const ItemListContainer = (props) => {
    return(
        <ul style={styles.ul}>
            <li>{props.Home}</li>
            <li>{props.Products}</li>
            <li>{props.AboutUs}</li>
        </ul>
    )
}

export default ItemListContainer;
